package original;
import org.junit.Test;
import static org.junit.Assert.*;

public class AntiShuffleTest {

    @Test
    public void testSortString() {
        // Test case 1: Single word
        String input1 = "Hi";
        String expected1 = "Hi";
        String result1 = AntiShuffle.sortString(input1);
        assertEquals(expected1, result1);

        // Test case 2: Single word with shuffled characters
        String input2 = "hello";
        String expected2 = "ehllo";
        String result2 = AntiShuffle.sortString(input2);
        assertEquals(expected2, result2);

        // Test case 3: Multiple words with shuffled characters
        String input3 = "Hello World!!!";
        String expected3 = "Hello !!!Wdlor";
        String result3 = AntiShuffle.sortString(input3);
        assertEquals(expected3, result3);

        // Test case 4: Empty string
        String input4 = "";
        String expected4 = "";
        String result4 = AntiShuffle.sortString(input4);
        assertEquals(expected4, result4);

        // Test case 5: String with special characters and spaces
        String input5 = "Hi. My name is Mister Robot. How are you?";
        String expected5 = ".Hi My aemn is Meirst .Rboot How aer ?ouy";
        String result5 = AntiShuffle.sortString(input5);
        assertEquals(expected5, result5);
    }
}

